export default [
    {
        path: "/",
        name: "index",
        redirect: "/home"
    },
    {
        path: "/home",
        name: "home",
        meta: {
            auth: [1]
        },
        component: () => import("@/views/Home/index.vue")
    },
    {
        path: "*",
        redirect: "/home"
    }
];
